.grid {
  display: block;

  @include onTablet {
    display: grid;
    grid-template-columns: repeat(8, 1fr);
    column-gap: 20px;
  }

  @include onDesktop {
    display: grid;
    grid-template-columns: repeat(12, 1fr);
    column-gap: 20px;
  }



  &--desktop {
    display: block;

    @include onTablet {
      display: block;
    }

    @include onDesktop {
      display: grid;
    }
  }


  &__item {

    &--row-2 {
      grid-row: 2;
    }

    &--row-1 {
      grid-row: 1/1;
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }

        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }

    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }

        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }

    &--special {
      display: none;

      @include onDesktop {
        display: grid;
      }

      @include onTablet {
        display: grid;
      }
    }


  }
}

